{/* <script src="https://widgets.coingecko.com/coingecko-coin-converter-widget.js"></script>
<coingecko-coin-converter-widget  coin-id="bitcoin" currency="usd" background-color="#ffffff" font-color="#4c4c4c" locale="en" width="300"></coingecko-coin-converter-widget> */}
{/* <script src="https://widgets.coingecko.com/coingecko-coin-converter-widget.js"></script>
<coingecko-coin-converter-widget  coin-id="bitcoin" currency="usd" background-color="#ffffff" font-color="#4c4c4c" locale="en"></coingecko-coin-converter-widget> */}
              </div>  

              <div className="crypto__data__display__chart" >
              {/* <script src="https://widgets.coingecko.com/coingecko-coin-price-chart-widget.js"></script>
<coingecko-coin-price-chart-widget  coin-id="bitcoin" currency="usd" height="300" locale="en" width="400"></coingecko-coin-price-chart-widget> */}


              <script type="text/javascript" src="https://www.cryptonator.com/ui/js/widget/calc_widget.js"></script>

              </div>

                    {/* {parseInt(quoteCurrencyRef.current.value) + parseInt(baseCurrencyRef.current.value)}
                    {console.log(quoteCurrencyRef.current.value)} */}
              </div>
          );
        }
      })}
    </div>
  );
};

//===================================================================================//
//===================================================================================//
const mapStateToProps = (state) => {
  return {
    cryptoData: state.cryptoData,
    selectedCryptoDisplay: state.selectedCryptoDisplay,
  };
};

export default connect(mapStateToProps, {
  setCryptoData,
  addCryptoData,
  showCryptoData,
})(CryptoDataDisplay);
